import React from 'react'
import { Redirect, Route } from 'react-router-dom';


const PrivateRoute = ({ component: Comp, loggedIn, path }) => {
    return (
        <Route
            path={path}
            render={() => {
                return loggedIn ? (
                    loggedIn.role == "ROLE_USER" && Comp == "User" ? <Comp /> : (
                        loggedIn.role == "ROLE_ADMIN" && Comp == "Admin" && <Comp />
                    )
                ) : (
                        <Redirect
                            to={{
                                pathname: "/"
                            }}
                        />
                    );
            }}
        />
    );
};

export default PrivateRoute
